        Vinet","email":"judd@betsmartmedia.com"},"repository":{"type":"git","url":"git://github.com/BetSmartMedia/custodian.git"},"readme":"##
        Custodian\n\nCustodian is a program somewhat similar to cron.  Unlike cron,
        Custodian\ncannot run programs at specific times, only at intervals (eg, every
        5\nminutes, or every 2 seconds).\n\nCustodian has a unique spin, however:
        It can also run programs *after*\nanother program has completed. This is quite
        useful in scenarios where you\nhave a number of programs that need to be run
        at regular intervals and in\na specific order.\n\nIn addition to relative
        scheduling, Custodian also provides basic watchdog\ncapabilities. When Custodian
        starts up, it will start all watched processes,\nand if one dies, it will
        attempt to restart it and notify you.\n\n\n### Example: Scheduling\n\nSay
        you have a script that fetches an external XML data feed, processes\nit, and
        loads it into your local database.  Once the ETL process is\ncomplete, you
        want to perform some post-processing actions on it.\n\nThis is an ideal use
        case for Custodian.  You can accomplish this with the\nfollowing configuration
        excerpt:\n\n```json\n{\n\t\"schedule\": {\n\t\t\"etl\":       {\"cmd\":\"etl.js\",
        \"when\":\"every 60s\"},\n\t\t\"postproc1\": {\"cmd\":\"pp1.js\", \"when\":\"after
        postproc1\"},\n\t\t\"postproc2\": {\"cmd\":\"pp2.js\", \"when\":\"after postproc1\"}\n\t}\n}\n```\n\n###
        Example: Watchdog\n\nThis excerpt will log all output from the watch_me.sh
        script to a file. If\nthe script dies, it will restart it and notify the administrator.\n\n```json\n{\n\t\"admin\":
        \"admin@example.com\",\n\n\t\"daemon\": true,\n\t\"log\": \"custodian.log\",\n\t\"pid\":
        \"custodian.pid\",\n\n\t\"watch\": {\n\t\t\"watch1\": {\"cmd\":\"watch_me.sh\",
        \"notify\":true, \"output\":\"watch1.log\"}\n\t}\n}\n```\n\n### Example: Environment
        variables\n\nTo set environment variables that will apply to all jobs, you
        can use the\n\"env\" key in your configuration:\n\n```json\n{\n\t\"env\":
        {\n\t\t\"API_KEY\": \"abcdef1234567890\"\n\t}\n}\n```\n\nYou can also specify
        environment variables inside `\"schedule\"` and `\"watch\"`\njobs:\n\n```json\n{\n\t\"env\":
        {\n\t\t\"API_KEY\": \"abcdef1234567890\"\n\t},\n\t\"watch\": {\n\t\t\"web-server\":
        {\n\t\t\t\"cmd\": \"npm start myapp\",\n\t\t\t\"env\": {\n\t\t\t\t\"PORT\":
        1234\n\t\t\t}\n\t\t}\n\t}\n}\n```\n\nConfiguration environment variables override
        pre-existing environment variables,\nand job-specific variables override both.\n\n###
        Example: Killing jobs that run too long\n\nSuppose you have a job that occasionally
        hangs, you can specify the \"maxtime\"\nparameter and custodian will kill
        the process if it runs beyond it''s limit:\n\n```json\n{\n\t\"schedule\":
        {\n\t\t\"my-job\": {\n\t\t\t\"cmd\": \"do a thing that sometimes fails\",\n\t\t\t\"maxtime\":
        \"10s\"\n\t\t}\n\t}\n}\n```\n\nNow if `my-job` runs more than 10 seconds,
        custodian will kill it for us.\nAnother interesting use of \"maxtime\" is
        to periodically restart watched jobs.\n","homepage":"https://github.com/BetSmartMedia/custodian","bugs":{"url":"https://github.com/BetSmartMedia/custodian/issues"},"readmeFilename":"README.md","users":{"coyool":true}}'
